import React, { useState, useEffect } from 'react';
import GeneralSettings from '../components/settings/GeneralSettings';
import EmailSettings from '../components/settings/EmailSettings';
import AppearanceSettings from '../components/settings/AppearanceSettings';
import CalendarIntegration from '../components/settings/CalendarIntegration';
import LicenseSettings from '../components/settings/LicenseSettings';
import AdvancedSettings from '../components/settings/AdvancedSettings';
import SystemInfo from '../components/settings/SystemInfo';
import { useApp } from '../context/AppContext';
import { useSettings } from '../context/SettingsContext';
import { Button } from '../components/ui/button';

// Default settings structure
const defaultSettings = {
  general: {},
  email: {},
  appearance: {},
  calendar: {},
  license: {},
  advanced: {},
};

function TabPanel({ children, value, index }) {
  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`settings-tabpanel-${index}`}
      aria-labelledby={`settings-tab-${index}`}
      className="py-3"
    >
      {value === index && (
        <div className="bg-white shadow rounded-lg p-6">{children}</div>
      )}
    </div>
  );
}

const Settings = () => {
  const [activeTab, setActiveTab] = useState(0);
  const { showNotification } = useApp();
  const {
    settings = defaultSettings,
    updateSettings,
    loading: saving,
  } = useSettings();

  const handleTabChange = (index) => {
    setActiveTab(index);
  };

  const handleSettingsUpdate = async (section, newSettings) => {
    try {
      await updateSettings(section, newSettings);
    } catch (error) {
      showNotification('error', 'Failed to update settings');
    }
  };

  const handleSaveSettings = async () => {
    try {
      // The settings are saved automatically when updated
      showNotification('success', 'Settings saved successfully');
    } catch (error) {
      showNotification('error', 'Failed to save settings');
    }
  };

  const tabs = [
    {
      name: 'General',
      component: (
        <GeneralSettings
          settings={settings?.general || {}}
          onUpdate={(s) => handleSettingsUpdate('general', s)}
        />
      ),
    },
    {
      name: 'Email',
      component: (
        <EmailSettings
          settings={settings?.email || {}}
          onUpdate={(s) => handleSettingsUpdate('email', s)}
        />
      ),
    },
    {
      name: 'Appearance',
      component: (
        <AppearanceSettings
          settings={settings?.appearance || {}}
          onUpdate={(s) => handleSettingsUpdate('appearance', s)}
        />
      ),
    },
    {
      name: 'Calendar',
      component: (
        <CalendarIntegration
          settings={settings?.calendar || {}}
          onUpdate={(s) => handleSettingsUpdate('calendar', s)}
        />
      ),
    },
    {
      name: 'License',
      component: (
        <LicenseSettings
          settings={settings?.license || {}}
          onUpdate={(s) => handleSettingsUpdate('license', s)}
        />
      ),
    },
    {
      name: 'Advanced',
      component: (
        <AdvancedSettings
          settings={settings?.advanced || {}}
          onUpdate={(s) => handleSettingsUpdate('advanced', s)}
        />
      ),
    },
    { name: 'System Info', component: <SystemInfo /> },
  ];

  // Show loading state while settings are being fetched
  if (!settings) {
    return (
      <div className="flex justify-center items-center min-h-screen">
        <div className="animate-spin h-8 w-8 border-4 border-primary-500 border-t-transparent rounded-full"></div>
      </div>
    );
  }

  return (
    <div className="w-full relative">
      {/* Header */}
      <div className="flex justify-between items-center mb-6">
        <h1 className="text-2xl font-bold text-gray-900">Settings</h1>
        <Button
          onClick={handleSaveSettings}
          disabled={saving}
          className="gap-2"
        >
          {saving ? (
            <>
              <div className="animate-spin h-4 w-4 border-2 border-white border-t-transparent rounded-full" />
              <span>Saving...</span>
            </>
          ) : (
            'Save Settings'
          )}
        </Button>
      </div>

      {/* Tabs */}
      <div className="bg-white rounded-lg shadow-sm mb-6">
        <div className="border-b border-gray-200">
          <div className="flex space-x-4 overflow-x-auto p-4">
            {tabs.map((tab, index) => (
              <Button
                key={index}
                onClick={() => handleTabChange(index)}
                variant={activeTab === index ? 'default' : 'ghost'}
                className={activeTab === index ? '' : 'text-muted-foreground'}
                role="tab"
                aria-selected={activeTab === index}
                aria-controls={`settings-tabpanel-${index}`}
                id={`settings-tab-${index}`}
              >
                {tab.name}
              </Button>
            ))}
          </div>
        </div>
      </div>

      {/* Tab Panels */}
      <div className="relative pb-20">
        {tabs.map((tab, index) => (
          <TabPanel key={index} value={activeTab} index={index}>
            {tab.component}
          </TabPanel>
        ))}

        {/* Sticky Save Settings Bar */}
        <div className="sticky bottom-0 left-0 right-0 bg-white border-t border-gray-200 p-4 shadow-lg z-10">
          <div className="max-w-7xl mx-auto flex justify-end">
            <Button
              onClick={handleSaveSettings}
              disabled={saving}
              size="lg"
              className="gap-2"
            >
              {saving ? (
                <>
                  <div className="animate-spin h-4 w-4 border-2 border-white border-t-transparent rounded-full" />
                  <span>Saving...</span>
                </>
              ) : (
                'Save Changes'
              )}
            </Button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Settings;
